object.script:
function onTick() Channel = input.getNumber(1) Decr = input.getBool(1) Incr = input.getBool(2)
if Decr == true then Channel = Channel-1 end if Incr == true then Channel = Channel+1 end
if Channel <= 0 then Channel = 99 end if Channel >= 100 then Channel = 1 end output.setNumber(1, Channel) end
